 import React from 'react'
 import styles from '../cssPage/potfolio.module.css'
 
 function Footer() {
   return (
     <div>
       {/* Footer */}
 <footer className={`${styles.footer} text-center text-light py-3`}>
 <p>
   &copy; 2024 weexydev | Designed with React & Bootstrap
 </p>
</footer>
     </div>
   )
 }
 
 export default Footer
